import React from "react";
import ReactDOM from "react-dom";
import "./index.css";
import App from "./App";
import * as serviceWorkerRegistration from "./serviceWorkerRegistration";
import reportWebVitals from "./reportWebVitals";
import "bootstrap/dist/css/bootstrap.css";
import { BrowserRouter } from "react-router-dom";
import { combineReducers, createStore } from "redux";
import { Provider } from "react-redux";

let member = [
  {
    mno: 1,
    email: "test@naver.com",
    nick: "testname1",
    pw: "qwer1234",
    point: 0,
  },
  {
    mno: 2,
    email: "test@naver.com",
    nick: "testname2",
    pw: "qwer1234",
    point: 0,
  },
  {
    mno: 3,
    email: "test@naver.com",
    nick: "testname3",
    pw: "qwer1234",
    point: 0,
  },
  {
    mno: 4,
    email: "test@naver.com",
    nick: "testname4",
    pw: "qwer1234",
    point: 0,
  },
  {
    mno: 5,
    email: "test@naver.com",
    nick: "testname5",
    pw: "qwer1234",
    point: 0,
  },
  {
    mno: 6,
    email: "test@naver.com",
    nick: "testname6",
    pw: "qwer1234",
    point: 0,
  },
  {
    mno: 7,
    email: "test@naver.com",
    nick: "testname7",
    pw: "qwer1234",
    point: 0,
  },
  {
    mno: 8,
    email: "test@naver.com",
    nick: "testname8",
    pw: "qwer1234",
    point: 0,
  },
  {
    mno: 9,
    email: "test@naver.com",
    nick: "testname9",
    pw: "qwer1234",
    point: 0,
  },
  {
    mno: 10,
    email: "test@naver.com",
    nick: "testname10",
    pw: "qwer1234",
    point: 0,
  },
  {
    mno: 11,
    email: "test@naver.com",
    nick: "testname11",
    pw: "qwer1234",
    point: 0,
  },
  {
    mno: 12,
    email: "test@naver.com",
    nick: "testname12",
    pw: "qwer1234",
    point: 0,
  },
];

let board = [""];

let reply = [""];

let value = [""];

let attach = [""];

function memberReducer(state = member, actions) {
  return state;
}

function boardReducer(state = board, actions) {
  return state;
}

function replyReducer(state = reply, actions) {
  return state;
}

function valueReducer(state = value, actions) {
  return state;
}

function attachReducer(state = attach, actions) {
  return state;
}

let store = createStore(
  combineReducers({
    memberReducer,
    boardReducer,
    replyReducer,
    valueReducer,
    attachReducer,
  })
);

ReactDOM.render(
  <React.StrictMode>
    <BrowserRouter>
      <Provider store={store}>
        <App />
      </Provider>
    </BrowserRouter>
  </React.StrictMode>,
  document.getElementById("root")
);

// If you want your app to work offline and load faster, you can change
// unregister() to register() below. Note this comes with some pitfalls.
// Learn more about service workers: https://cra.link/PWA
serviceWorkerRegistration.register();

// If you want to start measuring performance in your app, pass a function
// to log results (for example: reportWebVitals(console.log))
// or send to an analytics endpoint. Learn more: https://bit.ly/CRA-vitals
reportWebVitals();
